import Child from "./components/Child";

const Example = () => {
  const hello = (arg) => `Hello ${arg}`
  const boolean = false;
  return (
    <>
      <Child
        num={123}
        fn={hello}
        boolean
      />
      {/* <Child color="red" dada="dada" /> */}
    </>
  )
};

export default Example;
